import React from "react";
import { NavLink } from "react-router-dom";

export const CategoryItem =({ image, title, id })=> {
  return (
    <NavLink to={`/category/${id}`}>
      <img src={`http://localhost:3333${image}`} alt={title}></img>
      <h3>{title}</h3>
    </NavLink>
  );
}
